import React from 'react'
import ReactDOM from 'react-dom'

import {
    Nav, Hero, Card
} from './components'

let x = 5.0;

ReactDOM.render(
    <><Nav /><Hero/><Card img = "swimmer.jpeg" stars = {x} reviews = {6} country = "USA" description = "Life lessons with Katie" price = {136} /></>,
    document.getElementById('root')
)
